import React from 'react';
import logo from './logo.svg';
import './App.css';

function hello(props){
  return (
    <div>Hello World!</div>
  )
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>

        {hello}
      </header>
    </div>
  );
}

export default App;
